       :  Handle : MX_UINT32

       :  LayoutIndex : MX_SINT32
\*=----------------------------------------------------------------------=*/
function FCM_Prv_GetDCArray(FCL_HANDLE, FCL_IDX, FCL_COUNT, FCL_LAYOUTINDEX)
{
  const FC_THIS = '00000_panel';
  //Local variable definitions
  let FCL_POINTER = 0;  //
  let FCL_LAYOUTSTR = "";  //
  let FCL_PROPLAYOUT = "";  //
  let FCL_CHARACTER = 0;  //
  let FCL_LENGTH = 0;  //
  let FCL_VAL = 0;  //



  // Decision
  if (FCL_LAYOUTINDEX)
  {

    // Component Macro
    FCL_LAYOUTSTR = FCD_0b5b3_InputText3__GetText();

  } else {

    // Component Macro
    FCL_LAYOUTSTR = FCD_0b5b1_InputText1__GetText();

  }

  // Calculation
  FCL_LENGTH = FCI_GETLENGTH(FCL_LAYOUTSTR);

  // JavaScript
  let result = Array.from(FCL_LAYOUTSTR, char => char.charCodeAt(0));

  // Loop
  while ((FCL_IDX) && (FCL_POINTER < FCL_LENGTH))
  {
    // JavaScript
    FCL_CHARACTER = result[FCL_POINTER];

    // Decision
    if (FCL_CHARACTER == 44)
    {

      // Calculation
      FCL_IDX = FCL_IDX - 1;

    // } else {

    }

    // Calculation
    FCL_POINTER = FCL_POINTER + 1;

  }

  // Calculation
  FCL_VAL = 0;

  // Loop
  while ((FCL_IDX < FCL_COUNT) && (FCL_POINTER < FCL_LENGTH))
  {
    // JavaScript
    FCL_CHARACTER = result[FCL_POINTER];

    // Decision
    if (FCL_CHARACTER == 44)
    {

      // Component Macro
      FCD_0a601_Array1__ArrayAddValue(FCL_HANDLE, FCL_IDX, FCL_VAL);

      // Decision
      if ((FCL_COUNT == 255) && (FCL_VAL == 0))
      {

        // Calculation
        FCL_COUNT = FCL_IDX;

      // } else {

      }

      // Calculation
      FCL_IDX = FCL_IDX + 1;

      // Calculation
      FCL_VAL = 0;

    } else {

      // Calculation
      FCL_VAL = FCL_VAL * 10;
      FCL_VAL = FCL_VAL + (FCL_CHARACTER - 48);

    }

    // Calculation
    FCL_POINTER = FCL_POINTER + 1;

  }

  // Component Macro
  FCD_0a601_Array1__ArrayAddValue(FCL_HANDLE, FCL_IDX, FCL_VAL);

}

  //Check delay-start objects and start immediately if there are none
  if (MxDelayedObjects.length == 0)
  {
    MyMainFunction();
  }
</script>
